trailingComments.value:
*
 * 隐藏客户端导航栏
 *
 * 支持平台：书旗Android、书旗iOS
 *
 * @returns {Promise<Object>}
 *
 * @example
 * libSQ.exec('hidden-app-nav', {
 *   params,
 * }).catch((err) => {
 *   alert(`[hidden-app-nav][error] ${JSON.stringify(err, null, 2)}`);
 * });

